	var mod = {};
	function renderDistrict(elms, vals, opts) {
		if(!elms.district) {
			return false;
		}
		elms.district.options.length = 0;
		if(opts.withTitle) {
			elms.district.options.add(new Option('/', ''));
		}
		var opt = elms.province.options[elms.province.options.selectedIndex];
		var pid = $(opt).attr('pid');
		var opt = elms.city.options[elms.city.options.selectedIndex];
		var cid = $(opt).attr('cid');
		if(pid && cid) {
			$(elms.district).show();
			$.each(districts[pid].cities[cid].districts, function(i, val){
				var opt = new Option(val, val);
				elms.district.options.add(opt);
			});
		}
		if(vals.district) {
			$(elms.district).val(vals.district);
		}
	}
	function renderCity(elms, vals, opts) {
		if(!elms.city) {
			return false;
		}
		elms.city.options.length = 0;
		if(opts.withTitle) {
			elms.city.options.add(new Option('', ''));
		}
		var opt = elms.province.options[elms.province.options.selectedIndex];
		var pid = $(opt).attr('pid');
		if(pid) {
			$.each(districts[pid].cities, function(i, val){
				var opt = new Option(val.title, val.title);
				$(opt).attr('cid', i);
				elms.city.options.add(opt);
			});
		}
		if(vals.city) {
			$(elms.city).val(vals.city);
		}
		if(elms.district) {
			$(elms.city).on('change', function(){
				renderDistrict(elms, vals, opts);
			});
			$(elms.city).trigger('change');
		}
	}
	mod.render = function(elms, vals, opts){
		if(!elms.province) {
			return false;
		}
		elms.province.options.length = 0;
		if(opts.withTitle) {
			elms.province.options.add(new Option('/', ''));
		}
		$.each(districts, function(i, val){
			var opt = new Option(val.title, val.title);
			$(opt).attr('pid', i);
			elms.province.options.add(opt);
		});
		if(vals.province) {
			$(elms.province).val(vals.province);
		}
		if(elms.city) {
			$(elms.province).on('change', function(){
				renderCity(elms, vals, opts);
			});
			$(elms.province).trigger('change');
		}
	};
	return mod;
